import React, { useEffect, useState } from "react";
import axios from "axios";

function AdminDashboard() {
  const [candidates, setCandidates] = useState([]);
  const [votes, setVotes] = useState([]);
  const [formData, setFormData] = useState({
    name: "",
    position: "",
    department: "",
    yearOfStudy: "",
    school: "",
    manifesto: "",
  });

  const positions = [
    "Guild President",
    "Vice President",
    "Finance Minister",
    "Academic Minister",
  ];

  // Fetch candidates
  const getCandidates = async () => {
    const res = await axios.get("http://localhost:5000/api/candidates");
    setCandidates(res.data);
  };

  // Fetch all votes
  const getVotes = async () => {
    const res = await axios.get("http://localhost:5000/api/votes");
    setVotes(res.data);
  };

  useEffect(() => {
    getCandidates();
    getVotes();
  }, []);

  // Handle new candidate registration
  const handleChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:5000/api/candidates/register", formData);
      alert("✅ Candidate Registered!");
      setFormData({
        name: "",
        position: "",
        department: "",
        yearOfStudy: "",
        school: "",
        manifesto: "",
      });
      getCandidates();
    } catch (error) {
      console.error(error);
      alert("❌ Error registering candidate");
    }
  };

  // Get votes per candidate
  const votesForCandidate = (candidateId) =>
    votes.filter((v) => v.candidateId?._id === candidateId);

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <h1 className="text-3xl font-bold text-blue-700 mb-8">Admin Dashboard</h1>

      {/* Candidate Registration */}
      <div className="bg-white p-6 rounded-2xl shadow-md mb-10">
        <h2 className="text-2xl font-semibold text-gray-800 mb-4">Register New Candidate</h2>
        <form onSubmit={handleSubmit} className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <input
            name="name"
            value={formData.name}
            onChange={handleChange}
            placeholder="Candidate Name"
            className="border p-2 rounded"
            required
          />

          <select
            name="position"
            value={formData.position}
            onChange={handleChange}
            className="border p-2 rounded"
            required
          >
            <option value="">Select Position</option>
            {positions.map((pos) => (
              <option key={pos} value={pos}>
                {pos}
              </option>
            ))}
          </select>

          <input
            name="department"
            value={formData.department}
            onChange={handleChange}
            placeholder="Department"
            className="border p-2 rounded"
          />

          <input
            name="school"
            value={formData.school}
            onChange={handleChange}
            placeholder="School"
            className="border p-2 rounded"
          />

          <input
            name="yearOfStudy"
            value={formData.yearOfStudy}
            onChange={handleChange}
            placeholder="Year of Study"
            className="border p-2 rounded"
          />

          <textarea
            name="manifesto"
            value={formData.manifesto}
            onChange={handleChange}
            placeholder="Candidate Manifesto"
            className="border p-2 rounded col-span-full"
          />

          <button
            type="submit"
            className="col-span-full bg-blue-700 text-white py-2 rounded hover:bg-blue-800 transition"
          >
            Register Candidate
          </button>
        </form>
      </div>

      {/* Candidates List with Votes */}
      <div className="bg-white p-6 rounded-2xl shadow-md">
        <h2 className="text-2xl font-semibold text-gray-800 mb-4">
          Registered Candidates & Votes
        </h2>

        <table className="w-full border-collapse border">
          <thead>
            <tr className="bg-blue-50">
              <th className="border p-2">Name</th>
              <th className="border p-2">Position</th>
              <th className="border p-2">Department</th>
              <th className="border p-2">Votes</th>
            </tr>
          </thead>
          <tbody>
            {candidates.map((c) => (
              <tr key={c._id}>
                <td className="border p-2 font-medium">{c.name}</td>
                <td className="border p-2">{c.position}</td>
                <td className="border p-2">{c.department}</td>
                <td className="border p-2 text-center">
                  {votesForCandidate(c._id).length}{" "}
                  <button
                    onClick={() =>
                      alert(
                        votesForCandidate(c._id)
                          .map((v) => `- ${v.studentId?.name}`)
                          .join("\n") || "No votes yet"
                      )
                    }
                    className="ml-2 text-blue-600 underline"
                  >
                    View
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default AdminDashboard;
